import axios from 'axios'

const instance = axios.create({
    baseURL: 'http://localhost:3000',
    headers: {
        'content-type':'application/octet-stream'
    }
});

export default {
    postData: () =>
    instance({
        'method':'POST',
        'url':'/customer',
        'data': {},
        'headers': {
            'content-type':'application/json'
        }
    })
}
